const GoalDetail = props => {
  return (
    <div>
      <hr />
      <p>Detail for: {props.title}</p>
      <p>{props.description}</p>
      <p>{props.hours}</p>
      <p>{props.totalTime}</p>
      <p>{props.goalCompleted}</p>
      <label>Add Description</label>
      <input type="text"></input>
      <label>Add Hours</label>
      <input type="text"></input>
      <button>Edit</button>
      <button>Delete</button>
      <hr />
    </div>
  );
};

export default GoalDetail;
